def check_dict_keys(obj, path="root"):
    if isinstance(obj, dict):
        for k, v in obj.items():
            if not isinstance(k, (str, int, float, bool, type(None))):
                print("Bad key at", path, "->", repr(k), "of type", type(k))
            check_dict_keys(v, f"{path}[{repr(k)}]")
    elif isinstance(obj, (list, tuple, set)):
        for i, v in enumerate(obj):
            check_dict_keys(v, f"{path}[{i}]")
    # other types are fine, ignore

